for y = 1:5 % top 10 PCs
    for x = 1:4 % # of states
        for n = 1:30 % # of examples
            if size_score_osc_high(n,x,i) > 0
                newYvalsH(:,n,y,x,i) = interp1(1:1:size_score_osc_high(n,x,i), score_osc(1:size_score_osc_high(n,x,i),y,n,x,i), linspace(1,size_score_osc_high(n,x,i),50));
            else
                newYvalsH(:,n,y,x,i) = NaN;
            end        
        end
    end
    sprintf('%d',y)
end

manifold = squeeze(nanmean(nanmean(newYvalsH,2),5));

